import {SchoolSvg} from '../Icons/School'
import {HandShakeSvg} from '../Icons/HandShake'
import {MilitaryTechSvg} from '../Icons/MilitaryTech'

export const peopleDegreesData = [
    {
        icon: SchoolSvg,
        count: 55,
        color: '#2BCBBA'
    },
    {
        icon: MilitaryTechSvg,
        count: 12,
        color: '#706FD3'
    },
    {
        icon: HandShakeSvg,
        count: 45,
        color: '#FD9644'
    }
]
